  false,\n\t\"url\": null,\n\t\"notes\": \"This document presents results from an
  invertebrate study conducted on Fish Springs National Wildlife Refuge. The purposes
  of this study were to: 1) quanitify abundance and diversity of invertebrates in
  the various marsh units; 2) determine success of marsh management strategies such
  as drawdowns and prescribed burns in increasing diversity of invertebrates; and
  3) describe the distribution pattern, if any, of invertebrates in the Fish Springs
  marsh.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
